import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [ repository, setRepository] = useState<any>(['']);
  const [input, setInput] = useState<string>('')
  const logo: string = 'https://tibiawiki.com.br/images/5/52/Tibia_Logo.png'

  useEffect(() => {
    axios.get(`https://api.tibiadata.com/v2/characters/${input}.json`)
    .then((res)=> {
      setRepository(res)
    })
    .catch((err) => console.log(err)
    )
  },[input])

  const handleSubmit = (e: any) => {
    e.preventDefault()
    console.log(repository)
    setInput('')
  }

  return (
      <div className="App">
        <header className="App-header">
          <img src={logo} alt="tibia" />
          <h1>Tibia Character Information</h1>
          <form onSubmit={handleSubmit}>
            <input type="text" placeholder='Digite o nome do personagem' value={input} onChange={(e) => setInput(e.target.value)}/>
            <button type='submit'>Verify</button>
          </form>
          <table>
          </table>
        </header>
      </div>
  );
}

export default App;
